        let state = {year: temp}
    }

  return (
    <Container>
        <Container className='header'></Container>
        <Container className='navigation'>
            <h1>Movie ranking</h1>
            <Button variant="outline-secondary" onClick={() => navigate('/')}>All movies</Button>
            <Button variant="outline-secondary" onClick={() => navigate('/topMovies', {state:{year: ""}})}>Top 10 Revenue</Button>
            <Button variant="outline-secondary" onClick={() => navigate('/topMovies', {state:{year: 2011}})}>Top 10 Revenue per Year</Button>
        </Container>
    </Container>
  )
}

